import React, { useEffect } from "react";
import { useState } from "react";
import { useNavigate } from "react-router-dom";
import smartContractServices from '../../services/smartcontractservices';
import Carousel from "react-elastic-carousel"
import CircularProgress from '@mui/material/CircularProgress';
import Box from '@mui/material/Box';
import ProductIcon from '../../common/assets/productsIcon.svg';

import DataViz1 from '../../common/assets/data-1.png';
import DataViz2 from '../../common/assets/data-2.png';
import DataViz3 from '../../common/assets/data-3.png';
import {
  ProductsContainer,
  ProductsWrapper,
  ProductsWrapperCar,
  ProductsContainerCar,
  ProductsCard,
  ProductsIcon,
  ProductsH1,
  ProductsH2,
  ProductsP,
} from "./ProductElements";
import { height } from "@mui/system";


function Products() {
  const navigate = useNavigate();
  //const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true)
  // const getData = () => {
  //   // fetch("https://api.adviceslip.com/advice")
  //   //     .then((response) => response.json())
  //   //     .then((data) => {
  //   //         setData(data.slip.advice);
  //   //     });
  //   smartContractServices.getAllProducts().then(response => {
  //     console.log(response.data)
  //     setData(response.data)
  //     setLoading(e => !e)
  //   }).catch(error => {
  //     console.log(error)
  //   })

  // }

  useEffect(() => {
    getData();
  }, []);


  // window.addEventListener("beforeunload", (event) => {
  //   getData();
  //   console.log("API call before page reload");
  // });

  // window.addEventListener("unload", (event) => {
  //   getData();
  //   console.log("API call after page reload");
  // });
  // const handleClick = (event, param) => {
  //   console.log("dddddddd", event)
  //   console.log("pppp", param)
  //   navigate(`/createcontract/${param}`);
  // };


  return (
    <>
      <ProductsContainer id="products">
        <ProductsH1>Create New Product Version</ProductsH1>
        {loading
          ? <div style={{
            margin: "auto",
            top: "50%",
            display: "block",
          }}>
            <Box sx={{ display: 'flex' }}>
              <CircularProgress />
            </Box>
          </div>
          :
          <ProductsContainerCar id="products">
                    <ProductsCard>
                      <ProductsIcon src={DataViz1} />
                      <ProductsH2>Pair Plots Visualization</ProductsH2>
                      <ProductsP>Pair Plot visualization for each pair of features</ProductsP>
                    </ProductsCard>
                    <ProductsCard>
                      <ProductsIcon src={DataViz2} />
                      <ProductsH2>Heat Maps Visualization</ProductsH2>
                      <ProductsP>HeatMap Visualization for each pair of features</ProductsP>
                    </ProductsCard>
                    <ProductsCard >
                      <ProductsIcon src={DataViz3} />
                      <ProductsH2>Distribution Plot Visualization</ProductsH2>
                      <ProductsP>Distribution Plot  Visualization for each feature</ProductsP>
                    </ProductsCard>
          </ProductsContainerCar>
        }
      </ProductsContainer>
    </>
  );
};

export default Products;
